import React from 'react';
import './App.css';
import LandingPage from './components/LandingPage';
import { Link } from "react-router-dom";

/*
function Home() {
    return (
        <div>
            <h1>My Website</h1>
        </div>
    );
}*/

export function About() {
    return (
        <div>
            <nav>
                <Link to="/">Home</Link>
                <Link to="/about">About</Link>
                <Link to="/contact">Contact</Link>
            </nav>
            <h1>About Us</h1>
        </div>
    );
}

export function Contact() {
    return (
        <div>
            <nav>
                <Link to="/">Home</Link>
                <Link to="/about">About</Link>
                <Link to="/contact">Contact</Link>
            </nav>
            <h1>Contact Us</h1>
        </div>
    );
}

export function App() {
    return (
        <div className="App">
            <nav>
                <Link to="/">Home</Link>
                <Link to="/about">About</Link>
                <Link to="/contact">Contact</Link>
            </nav>
            <LandingPage />
        </div>
    );
}

//export default App;
